import React, { Component } from 'react';


class Wikipedia extends Component {

    constructor(props) {
      super(props)
    
      this.state = {first:'',
                    second:'',
                    third:'',
                    fourth:''
         
      }
    }

    change = ()=>{alert}
    
    render() {
        return (
            <div>
                <label>Wikipedia</label><br/>
                <input type='text' value={this.state.first} 
                placeholder='search' 
                OnChange={this.change}/>
            </div>
        );
    }
}

export default Wikipedia;
